    <meta name="description" content="signin">
		<style type="text/css">
			.signin_box {
				width: 500px;
				height: auto;
				background: #fff;
				box-sizing: border-box;
				padding: 50px 50px;
				border-radius: 2px;
				transition: all .1s ease-in-out;
				float: left;
				overflow-y: auto;
				display: table-cell;
				border-right: 2px solid #f1f1f1;
			}
			.zoho_logo {
				display: block;
				margin-bottom: 20px;
				background: /*savepage-url=https://static.zohocdn.com/iam/v2/components/images/newZoho_logo.5f6895fcb293501287eccaf0007b39a5.svg*/ var(--savepage-url-11) no-repeat transparent;
				background-size: auto 100%;
				height: 40px;
			    width: auto;
			}
			.darkmode .zoho_logo{background-image: /*savepage-url=https://static.zohocdn.com/iam/v2/components/images/newZoho_logo_dark.aed96a3461d2b82c4145185f95c4b491.svg*/ url();}
			@media (min-width: 600px) and (max-width: 1024px) {
				.signin_box {   
					width: 100%;
					border-right: none;
			    }
			}
			@media only screen and (max-width: 600px) {
				.signin_box {   
					width: 100%;
				    padding: 0px 30px;
				    height: auto;
				    border-right: none;
			    }
			}
			body{margin: 0px;}
			.load-bg{top:0px}
			.darkmode .load-bg{background-color: #191A23}
			.line_loader{transform: scale(1);}

	<body>
<style>
	 .load-bg{
	 	background-color: #FFFFFF;
	 	width: 100%;
		height: 100%;
		position: absolute;
		z-index: 100;
		opacity: 1;
		transition: opacity .2s linear;
		top: 0;
		left: 0;
	 }
	 .load-fade{
		opacity: 0;
	 }
	 .basic-box-s {
		display: block;
		position: absolute;
	    top: 0px;
	    left: 0px;
	    right: 0px;
	    bottom: 0px;
	    width: 50px;
	    height: 50px;
	    margin: auto;
     }
      .box-anim {
        animation: load-anim 2s cubic-bezier(0.83, -0.01, 0.22, 1) infinite;
      }
       @keyframes load-anim {
        0% {
          transform: rotate(0deg);
        }
        10% {
          transform: rotate(-30deg);
        }
        50%{
            transform: rotate(180deg);
        }
        60%{
            transform: rotate(165deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
       .path {
        stroke-dasharray: 150px;
        stroke-dashoffset: 150px;
        stroke-linecap: round;
      }
      .path1-anim {
        animation: stroke-anim1 4s cubic-bezier(0.83, -0.01, 0.22, 1) infinite;
      }
      .path2-anim {
        animation: stroke-anim2 4s cubic-bezier(0.83, -0.01, 0.22, 1) infinite;
      }
      .path3-anim {
        animation: stroke-anim3 4s cubic-bezier(0.83, -0.01, 0.22, 1) infinite;
      }
      .path4-anim {
        animation: stroke-anim4 4s cubic-bezier(0.83, -0.01, 0.22, 1) infinite;
      }
       @keyframes stroke-anim1 {
        0% {
          stroke-opacity: 1;
          stroke-dashoffset: 150px;
        }
        3% {
          stroke-dashoffset: 150px;
        }
        21%,
        25% {
          stroke-dashoffset: 0;
        }
        50% {
          stroke-opacity: 1;
        }
        100% {
          stroke-dashoffset: 0px;
          stroke-opacity: 0;
        }
      }
      @keyframes stroke-anim2 {
        0% {
          stroke-dashoffset: 150px;
        }
        25% {
          stroke-opacity: 1;
          stroke-dashoffset: 150px;
        }
        28% {
          stroke-dashoffset: 150px;
        }
        46%,
        50% {
          stroke-dashoffset: 0px;
        }
        75% {
          stroke-dashoffset: 0px;
          stroke-opacity: 1;
        }
        100% {
          stroke-dashoffset: 0px;
          stroke-opacity: 0;
        }
      }
      @keyframes stroke-anim3 {
        0% {
          stroke-opacity: 0;
          stroke-dashoffset: 150px;
        }
        49% {
          stroke-opacity: 0;
        }
        50% {
          stroke-opacity: 1;
          stroke-dashoffset: 150px;
        }
        53% {
          stroke-dashoffset: 150px;
        }
        71%,
        75% {
          stroke-dashoffset: 0;
        }
        100% {
          stroke-dashoffset: 0;
          stroke-opacity: 1;
        }
      }
      @keyframes stroke-anim4 {
        0% {
          stroke-dashoffset: 150px;
          stroke-opacity: 0;
        }
        74% {
          stroke-opacity: 1;
        }
        75% {
          stroke-opacity: 1;
          stroke-dashoffset: 150px;
        }
        78% {
          stroke-dashoffset: 150px;
        }
        96%,
        100% {
          stroke-dashoffset: 0;
        }
